import { Component } from '@angular/core';
import { Router } from '@angular/router';
import { Bike } from '../../models/bike';
import { BikeCategory } from '../../models/bike-category';
import { BikeService } from '../../services/bike.service';

@Component({
  selector: 'app-add-bike',
  templateUrl: './add-bike.component.html',
  styleUrls: ['./add-bike.component.css']
})
export class AddBikeComponent {
  categories = Object.values(BikeCategory);
  error = '';
  saving = false;

  bike: Partial<Bike> = {
    name: '',
    kategorie: BikeCategory.Rennrad,
    kilometerstand: 0,
    stravaId: ''
  };

  constructor(private bikeService: BikeService, private router: Router) {}

  save(): void {
    if (!this.bike.name?.trim()) {
      this.error = 'Bitte einen Namen angeben.';
      return;
    }
    this.saving = true;
    this.bikeService.addBike(this.bike as Bike).subscribe({
      next: created => {
        this.router.navigate(['/bikes', created.id]);
      },
      error: () => {
        this.error = 'Fehler beim Speichern des Rads.';
        this.saving = false;
      }
    });
  }

  cancel(): void {
    this.router.navigate(['/bikes']);
  }
}
<div class="back-link" (click)="cancel()">← Zurück</div>
<h2>Neues Rad hinzufügen</h2>

<div *ngIf="error" class="error">{{ error }}</div>

<form class="form-card" (ngSubmit)="save()">

  <div class="form-group">
    <label for="name">Name</label>
    <input id="name" type="text" [(ngModel)]="bike.name" name="name" placeholder="z.B. Canyon Ultimate" required />
  </div>

  <div class="form-group">
    <label for="kategorie">Kategorie</label>
    <select id="kategorie" [(ngModel)]="bike.kategorie" name="kategorie">
      <option *ngFor="let cat of categories" [value]="cat">{{ cat }}</option>
    </select>
  </div>

  <div class="form-group">
    <label for="km">Aktueller Kilometerstand</label>
    <input id="km" type="number" [(ngModel)]="bike.kilometerstand" name="kilometerstand" min="0" />
  </div>

  <div class="form-group">
    <label for="stravaId">Strava-ID (optional)</label>
    <input id="stravaId" type="text" [(ngModel)]="bike.stravaId" name="stravaId" placeholder="Strava Rad-ID" />
  </div>

  <div class="form-actions">
    <button type="submit" class="btn-primary" [disabled]="saving">
      {{ saving ? 'Speichert...' : 'Rad speichern' }}
    </button>
    <button type="button" class="btn-secondary" (click)="cancel()">Abbrechen</button>
  </div>

</form>
